import React from 'react';
import { FaStar } from 'react-icons/fa';
import Star from './Star'
function Stars({ totalStars = 5 }) {
  const createArray = (length) => [...Array(length)];
  return createArray(totalStars).map((n,i))
}

export default Stars;
